import styled from 'styled-components';

export const NavContainer = styled.nav`
  display: flex;
  align-items: center;
  justify-content: space-between;
  padding: 0;

  ul {
    display: flex;
    /* justify-content: right; */
    gap: 1rem;
    list-style-type: none;
  }
`;

export const LogoContainer = styled.div`
  display: flex;
  position: absolute;
  top: 0;
  /* position: absolute; */
  align-items:right;
  justify-content: right;
`;
